import React, { useState } from "react";
import Bill from "../Bill";

const Loan = () => {

  const [currentRadioValue, setCurrentValue] = React.useState('on');

  const handleRadioChange = (e) => {
    setCurrentValue(e.target.value);
  };

  return (
    <>
    <Bill />
     <h1>NEW LOAN</h1>
     <h1>RP LOAN</h1>
     <h1>PERSONAL LOAN</h1>
     <div>
        <input name="radio-item-1"  type="radio"  value="radio-1" onChange={handleRadioChange} checked={currentRadioValue === 'radio-1'} />
        <label >Radio Item 1</label>
      </div>
      <div>
        <input id="radio-item-2" name="radio-item-2" type="radio" value="radio-2" onChange={handleRadioChange}  checked={currentRadioValue === 'radio-2'} />
        <label htmlFor="radio-item-2">
          Radio Item 1
        </label>
      </div>
    </>
  );
};

export default Loan;
